トレパンマン 男の子用 Lサイズ 36枚<br>ブランド：トレパンマン<br>販売・製造元：ユニ・チャーム<br><br>トレーニング用紙おむつです。<br>モレずに10倍ぬれた感じを実現しました。<br>男の子用、Lサイズ、36枚。<br>※デザインは予告なく変更されることがあります。<br> <br><br><br>使用上の注意<br>●汚れた紙おむつは早くとりかえてください。<br>●テープは直接お肌につけないでください。<br>●誤って口に入れたり、のどにつまらせることのないよう、保管場所に注意し、使用後はすぐに処理してください。<br> ご注意<br>●紙おむつに付着した大便は、トイレに始末してください。<br>●汚れた部分を内側にして丸めて、不衛生にならないように処理してください。<br>●トイレに紙おむつを捨てないでください。<br>●使用後の紙おむつの廃棄方法は、お住まいの地域のルールに従ってください。<br>●外出時に使った紙おむつは持ち帰りましょう。<br> 素材表面材：ポリオレフィン・レーヨン不織布吸水材：綿状パルプ、吸水紙、高分子吸水材防水材：ポリオレフィンフィルム止着材：ポリオレフィン伸縮材：ポリウレタン結合材：スチレン系エラストマー合成樹脂外装材：ポリエチレン <br><br>お問い合わせ先<br>ユニ・チャーム株式会社 お客様相談センター0120-192-862 <br>ベビー＆キッズ／おむつ／紙おむつ／トレーニングおむつ<br>JANコード： 4903111186273<br><br>CS：4<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
